import { CSpinner } from "@coreui/react"
import { Grid } from "@mui/material"
import React,{ useState } from "react";

export const Loader =()=>{
    return(
        <Grid
        style={{
            backgroundColor:"palegreen",
            width:"100%",
            height:"100%",
            position:"absolute"
        }}
        >
            <CSpinner
            variant="grow"
            color="primary"
            style={{
                position:"absolute",
                transform:"ScaleX(0.5)",
                left:"50%"
            }}
            />
        </Grid>
    )
}
